import React from "react";

function TodoMemoDivRender({renderList}){
    var returnList =[]
    var i=0;
    while(i<renderList.length){
        returnList.push(<div className="todoMainElement" key={renderList[i].todolist}>{renderList[i].todolist}</div>);
        i=i+1
    }
    return(
        returnList
    );
};

export default TodoMemoDivRender;
